import React from 'react';
import { Balloon, Img, Heading, TrashIcon } from './components/index';
import images from "../src/images.png"

const App = () => {

  const clickIcon = () => {
    console.log("clicked")
  }

  return (
    <>
      <Balloon
        children="a"
        className="balloon2"
        style={{ position: 'absolute', top: '200px' }}
      />
      <Img width="128" src={images} />
      <Heading
        children="見出し"
        className='h2 h'
        style={{color:"red"}}
      />
      <TrashIcon
        className='clickable'
        onClick={clickIcon}
        src={images}
        style
      />
    </>
  );
};

export default App;
